#!usr/bin/python

def pattern_matching(genome, pattern):
    output_array = []
    for i in range(0, len(genome) - len(pattern)):
        if genome[i:len(pattern) + i] == pattern:
            output_array.append(i)

    fi = open("pattern_matching_output.txt", "w")
    for val in output_array:
        fi.write(str(val) + " ")
    return output_array

pattern_matching("", 
"TTCGTAGTT")
